import React from 'react';
import Head from 'next/head';

import AppLayout from '../components/AppLayout';
import NicknameEditForm from '../components/NicknameEditForm';
import FollowList from '../components/FollowList';

const Profile = () => {
  const followerList = [{ nickname: '제로초' }, { nickname: '네로초' }];
  const followingList = [{ nickname: '제로초' }, { nickname: '네로초' }];

  return (
    <>
      <Head>
        <title>프로필 | boardReact</title>
      </Head>
      <AppLayout>
        <NicknameEditForm />
        <FollowList header="팔로잉 목록" data={followerList} />
        <FollowList header="팔러워 목록" data={followingList} />
      </AppLayout>
    </>
  );
};

export default Profile;
